  input: TEXT,F3A,,"This Amendment is in response to a request for additional information
    regarding disbursements to vendor Victory Enterprises for 'Campaign Management
    & staff'. The disbursements to this vendor have been amended or split to indicate
    that the staff expense is for temp staff. The staff supplied are solely employees
    of Victory Enterprises (the vendor confirmed to the Committee Treasurer that it
    is not operating as a payroll service), and the persons supplied are subject to
    change. To date, the temp staff supplied have been stable and have been two individuals.
    On January 31, 2006 the Committee Treasurer spoke to Senior Campaign Finance Analyst
    Camilla Reminsky and explained this situation, and after obtaining a second opinion,
    directed the Committee Treasurer that the disbursements should be amended to indicate
    temp staff, and that memo entries regarding the name, address, date, amount and
    purpose of the temp staff individuals supplied would not be necessary. Respectfully
    submitted, Kirk Whalen, Treasurer 2-3-2006"
